import React from 'react';
import { Table, Label} from 'reactstrap';

export default class Example extends React.Component {

  constructor(props){
    super(props);
    this.state = 
    {
      songs: [],
      isLoaded: false,
    };

  }
  componentDidMount(){
    fetch('https://se3309-final-project-amali28.c9users.io:8081/retrievePlaylistSongs')
    .then(res=> res.json())
    .then(json => {
   this.setState({
        isloaded: true,
        songsForPlaylist: json,
      })
    });
  }

  render() {
    return (
      <Table>
        <thead>
          <tr>
            <th>#</th>
            <th>Song Name</th>
            <th>Hit Count</th>
            <th>Data Released </th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            <td>Mark</td>
            <td>Otto</td>
            <td>@mdo</td>
          </tr>
          <tr>
            <th scope="row">2</th>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <th scope="row">3</th>
            <td>Larry</td>
            <td>the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
    );
  }
}
